import { SectionContainer, SectionContent } from "./styles";

export const Contact = () => {
  return (
    <SectionContainer id="contact">
      <SectionContent id="contact">
        <Header title="Get in touch" />
      </SectionContent>
    </SectionContainer>
  );
};
